import React from 'react'

const Header = (props) => {
  return(
  <>
  <h1>{props.course}</h1>
  </>
  )
}

const Part = (props) => {
  return(
    <>
    <p>{props.name} {props.exercises}</p>
    </>
  )
}

const Content = (part1, part2, part3) => {
  return (
    <div>
      <Part name = {part1.name} exercises={part1.exercises}/>
      <Part name = {part1.name} exercises={part2.exercises}/>
      <Part name = {part1.name} exercises={part3.exercises}/>
    </div>
  )
}

const Total = (props) => {
  return(
  <>
  <p>Number of exercises {props.number}</p>
  </>
  )
}

const App = () => {
  const course = 'Half Stack application development'
  const part1 = {
    name: 'Fundamentals of React',
    exercises: 10
  }
  const part2 = {
    name: 'Using props to pass data',
    exercises: 7
  }
  const part3 = {
    name: 'State of a component',
    exercises: 14
  }

  return (
    <div>
      <Header />
      <Content />
      <Total number = {part3.exercises + part2.exercises + part1.exercises }/>
    </div>
  )
}

